use mutuelle_centralisee;


-- drop table entity ;
create table entity (
ent_id int primary key  ,
ent_name varchar(200),
ent_addresse varchar(200),
ent_phone varchar(15),
ent_site varchar(100) default ""

)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- drop table officials;
create table officials (

official_id int primary key,
firstname varchar(50),
lastname varchar(50),
cin varchar(50),
phone varchar(50),
email varchar(50),
password varchar(225),
ent_id int,
foreign key (ent_id) references `entity` (`ent_id`) on delete cascade

)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

-- drop table client;

create table client (
client_id int primary key,
work_badge varchar(10),
company_name varchar(50),
hire_date date DEFAULT NULL,
firstname varchar(50),
lastname varchar(50),
cin varchar(9),
passporte varchar(10),
phone varchar(50),
email varchar(50),
password varchar(225),
addresse varchar(200),
created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
official_id int ,
foreign key (official_id) references `officials` (`official_id`) on delete cascade

)ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;


delete from entity;





select * from officials;


select * from client;







